				fun hasInsulin (dosageT, capCart) =
if (dosageT > 0.0) then 
   if (abs (dosageT - INFUSIONLIMIT) > epsilon) andalso
	  (INFUSIONLIMIT > dosageT) 
   then hasInsulinAux1(dosageT, capCart)
   else
	  if (abs (dosageT - INFUSIONLIMIT) < epsilon) 
	  then hasInsulinAux1(dosageT, capCart)
	  else hasInsulinAux2(capCart)
else empty;
